export function add33(a: number, b: number): number {
  return a + b;
}

export function subtract33(a: number, b: number): number {
  return a - b;
}

export function multiply33(a: number, b: number): number {
  return a * b;
}

export function divide33(a: number, b: number): number {
  return a / b;
}
